export const Default = () => {
  const [currentTab, setCurrentTab] = useState("\uC120\uD0DD1");

  const _items = data.map((item, idx) => (
    <SelectTag.Item
      key={idx}
      label={item}
      value={item}
      checked={currentTab === item}
      onChange={(e) => {
        const { value } = e.target as HTMLInputElement;

        setCurrentTab(value);
      }}
    />
  ));

  return <SelectTag items={_items} />;
};



